/* eslint-disable react/jsx-pascal-case */
import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Website_logo from "./components/Home Page Comp/logo";
import Logo_Name from "./components/Home Page Comp/logo_name";
import Profile_Pic from "./components/Home Page Comp/profile_pic";
import Create_Buttons from "./components/Home Page Comp/Create_Buttons";
import Header2 from "./components/Board Page Comp/Header2";
import MenuOverlay from "./components/Board Page Comp/menu_overlay";
import ProfileOverlay from "./components/Board Page Comp/profile_overlay";
import BoardHeader2 from "./components/Board Page Comp/header2_2";
import Body2 from "./components/Board Page Comp/Body2";

function App() {
  const logo_name = () => {
    console.log("hello world")
  }
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="App">
              <div id="container">
                <div id="header">
                  <div id="logo-container">
                    <Website_logo />
                    <Logo_Name onClick={logo_name}/>
                  </div>
                  <div id="profile-container">
                    <Profile_Pic />
                  </div>
                </div>
                <div id="content-body">
                  <div id="Your-Boards">Your Boards</div>
                  <div id="Boards-container">
                    <Create_Buttons />
                  </div>
                </div>
              </div>
            </div>
          }
        ></Route>
        <Route
          path="/:boardName"
          element={
            <div className="App">
              <div id="container-2">
                <Header2 />
                <div id="header2-content-body-container">
                  <MenuOverlay />
                  <ProfileOverlay />
                  <BoardHeader2 />
                  <Body2 />
                </div>
              </div>
            </div>
          }
        ></Route>
      </Routes>
    </Router>
  );
}

export default App;
